import React from 'react'

function MiComponente({rey}) {
  let votacion = 0;
  const sumar = () =>{
    votacion = votacion +1;

  }

  return (
    <div className='rey'>
      <p>{rey.nombre}</p>
      <h1 onClick={sumar} value={votacion}>{votacion}</h1>
    </div>
  )
}


export default MiComponente
